import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'

import { PatientsTable } from './PatientsTable.js'
import  PatientEntryForm  from './PatientEntryForm.js'

class App extends React.Component {
  constructor(props) {
    super(props);
    /*
    this.state = {
      patientName: "",
      age: "",
      symptoms: "",
      comments: "",
      roomNumber: "",
    };*/


    /*
    this.handleInputChange = this.handleInputChange.bind(this);
    this.addPatient = this.addPatient.bind(this);*/
  }
  componentDidMount() {
    fetch('/api/v1/songs', {
      method: 'GET',
      headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json',
      },
    })
      .then(res => res.json())
      .then(
        (result) => {
          console.log("Yeet")
          console.log(result)
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          console.log("Fail")
          console.log(error)
        }
      )
  }

  addPatientRequst() {

    fetch('/api/v1/songs/', {
      method: 'POST',
      headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        title: "sadf",
        artist : "sadf"
      })
    })
    .then(res => res.json())
    .then(
      (result) => {
        console.log("Yeet")
        console.log(result)
      },
      // Note: it's important to handle errors here
      // instead of a catch() block so that we don't swallow
      // exceptions from actual bugs in components.
      (error) => {
        console.log("Fail")
        console.log(error)
      }
    )
}



  //https://reactjs.org/docs/forms.html
  //Use that when we have a working back end
  render() {
    return (
      <div className="App">
        {/* Beginning of Form */}
        <div className="row">
          <div className="col-md-12">
            <PatientEntryForm></PatientEntryForm>
          </div>
          <div className="col-md-8" class="m-5">
            {/* Beginning of Table*/}
            <PatientsTable patients={this.patients} />
          </div>
        </div>
      </div>
    );
  }
}

export default App;
